const { formId, formField } = BuilderFormModel;

function _renderStepContent(step, values, setFieldValue, errors, checkBuildId, selectForm) {
  if (checkBuildId) {
    switch (step) {
      case 0:
        return <AccountForm formField={formField}  selectForm={selectForm}/>;
      case 1:
        return <AppThemeForm formField={formField} errors={errors} />;
      case 2:
        return <DeviceInfoForm formField={formField} />;
      case 3:
        return <FeaturesForm formField={formField} />;
      case 4:
        return <PackagesForm formField={formField} />;
      case 5:
        return <BuildForm formField={formField} />;
      // case 5:
      //   return <BuildSuccess formField={formField}/>;
      default:
        return <div>Not Found</div>;
    }
  } else {
    switch (step) {
      case 0:
        return <AccountForm formField={formField}  selectForm={selectForm}/>;
      case 1:
        return <AppThemeForm formField={formField} errors={errors} />;
      case 2:
        return <DeviceInfoForm formField={formField} />;
      case 3:
        return <FeaturesForm formField={formField} />;
      case 4:
        return <PackagesForm formField={formField} />;
      // case 5:
      //   return <BuildSuccess formField={formField}/>;
      default:
        return <div>Not Found</div>;
    }
  }
}

export function ScrollToError() {
  const formik = useFormikContext();
  const submitting = formik?.isSubmitting;

  useEffect(() => {
    const el = document.querySelector(".Mui-error, [data-error]");
    (el?.parentElement ?? el)?.scrollIntoView({
      behavior: "smooth",
      block: "center",
    });
  }, [submitting]);
  return null;
}

